import React, {useEffect, useState} from "react";
import "../../../css/header.css"

function Order() {
    const [order, setOrders] = useState([]);
    const url = "/order/deleteBy/id"

    const orders = () => {
        fetch("/order/get")
            .then(orders => orders.json())
            .then(orders => {
                console.log(orders);
                setOrders(orders)
            })
    }

    useEffect(() => {
        orders()
    })

    return (
        <>
            <div className="order">
                <table>
                    <tr>
                        <th>NAME</th>
                        <th>PHONE</th>
                        <th>DELETED</th>
                    </tr>
                    {
                        order.map((o) => (
                            <tr>
                                <td key={o.name}>{o.name}</td>
                                <td key={o.numberPhone}>{o.numberPhone}</td>
                                <td>
                                    <button onClick={() => {
                                        deleteById("orderId", o.id, url)
                                    }}>Delete
                                    </button>
                                </td>
                            </tr>
                        ))
                    }
                </table>
            </div>
        </>
    )
}

const deleteById = (nameKey, numberId, url) => {
    fetch(url, {
        method: "DELETE",
        body: JSON.stringify({
            nameKey: numberId,
        }),
        headers: {
            "Content-Type": "application/json", charset: "UTF-8"
        }
    }).then(orders => console.log(orders))
}

export default {
    Order, deleteById
}
